import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
//import TextField from '@material-ui/core/TextField';
import Typography from '@material-ui/core/Typography';
import MenuItem from '@material-ui/core/MenuItem';
import Icon from '@material-ui/core/Icon';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl'; 
import Select from '@material-ui/core/Select';

/* import Grid from '@material-ui/core/Grid'; */
/* import AccountCircle from '@material-ui/icons/AccountCircle'; */

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '50ch',
    },
  },
  margin: {
    margin: theme.spacing(1),
  },
}));

export default function BasicTextFields() {
  const classes = useStyles();
 // const [age] = React.useState('');

/*   const currencies = [
    {
      value: '',
      label: 'Elegir...',
    },
  ]; */

  return (
    
    <form className={classes.root} noValidate autoComplete="off">
      
      <Typography variant="subtitle1" color="inherit" className="mt-8 sm:mt-16 mx-auto max-w-512">
        Ingresa los datos de cada Estudiante
			</Typography>
      <FormControl className={classes.formControl}>
        <InputLabel htmlFor="age-native-simple">Age</InputLabel>
        <Select
          native
          inputProps={{
            name: 'age',
            id: 'age-native-simple',
          }}
        >
          <option aria-label="None" value="" />
          <option value={10}>Ten</option>
          <option value={20}>Twenty</option>
          <option value={30}>Thirty</option>
        </Select>
      </FormControl>
      <FormControl className={classes.formControl}>
        <InputLabel id="demo-simple-select-label">Tipo de Documento</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={1}>C.C</MenuItem>
          <MenuItem value={2}>T.I</MenuItem>
        </Select>
      </FormControl>

  {/*       <TextField
          id="standard-select-currency"
          select
          label="Tipo de Documento"
      >
        <MenuItem value={10}>Ten</MenuItem>
        <MenuItem value={20}>Twenty</MenuItem>
        <MenuItem value={30}>Thirty</MenuItem>
        {/*   {currencies.map((option) => (
            <MenuItem key={option.value} value={option.value}>
              {option.label}
            </MenuItem>
          ))} }
      </TextField> */}

      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Número de Documento*</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start"> <Icon className="text-30" color="action">
              blur_circular
								</Icon>
          </InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Nombres*</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">  <Icon className="text-30" color="action">
            person
								</Icon></InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Apellidos*</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">  <Icon className="text-30" color="action">
            person_add
								</Icon></InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Telefono</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">  <Icon className="text-30" color="action">
            phone
								</Icon></InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Correo Electronico</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">  <Icon className="text-30" color="action">
            alternate_email
								</Icon></InputAdornment>}
        />
      </FormControl>


        {/*  <TextField id="standard-basic" label="Standard" />
        <TextField id="standard-basic" label="Standard" /> */}
       
    </form>
  );
}
